import Month from './Month';

let year = 2020;
let months = [];
export default class Year{
    newYear = (yearIn)=>{
        year = yearIn;
    };
    getYear=()=>{
        return year;
    };
    addMonth(monthIn){
        months.push(monthIn);
    };
}
